// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingSystem {
    enum ElectionStatus { NotStarted, Ongoing, Finished }

    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    address public administrator;
    ElectionStatus public currentStatus;

    mapping(uint => Candidate) private candidateList;
    mapping(address => bool) private hasVoted;
    mapping(address => bool) private authorizedVoters;
    uint public candidateCount;
    uint public voterCount;

    event ElectionStarted();
    event ElectionEnded();
    event CandidateAdded(uint candidateId, string candidateName);
    event VoterAuthorized(address voterAddress);
    event VoteCast(address voter, uint candidateId);

    modifier onlyAdmin() {
        require(msg.sender == administrator, "Action restricted to admin");
        _;
    }

    modifier inStatus(ElectionStatus status) {
        require(currentStatus == status, "Invalid election status for this action");
        _;
    }

    constructor() {
        administrator = msg.sender;
        currentStatus = ElectionStatus.NotStarted;
        _addCandidate("Candidate A");
        _addCandidate("Candidate B");
    }

    function startElection() external onlyAdmin inStatus(ElectionStatus.NotStarted) {
        currentStatus = ElectionStatus.Ongoing;
        emit ElectionStarted();
    }

    function endElection() external onlyAdmin inStatus(ElectionStatus.Ongoing) {
        currentStatus = ElectionStatus.Finished;
        emit ElectionEnded();
    }

    function addCandidate(string memory _name) external onlyAdmin inStatus(ElectionStatus.NotStarted) {
        _addCandidate(_name);
    }

    function _addCandidate(string memory _name) internal {
        candidateList[candidateCount] = Candidate(candidateCount, _name, 0);
        emit CandidateAdded(candidateCount, _name);
        candidateCount++;
    }

    function authorizeVoter(address _voter) external onlyAdmin inStatus(ElectionStatus.NotStarted) {
        require(!authorizedVoters[_voter], "Voter is already authorized");
        authorizedVoters[_voter] = true;
        voterCount++;
        emit VoterAuthorized(_voter);
    }

    function castVote(uint _candidateId) external inStatus(ElectionStatus.Ongoing) {
        require(authorizedVoters[msg.sender], "You are not authorized to vote");
        require(!hasVoted[msg.sender], "You have already voted");
        require(_candidateId < candidateCount, "Invalid candidate ID");

        hasVoted[msg.sender] = true;
        candidateList[_candidateId].voteCount++;
        emit VoteCast(msg.sender, _candidateId);
    }

    function getCandidate(uint _candidateId) external view returns (string memory name, uint voteCount) {
        require(_candidateId < candidateCount, "Invalid candidate ID");
        Candidate memory candidate = candidateList[_candidateId];
        return (candidate.name, candidate.voteCount);
    }

    function getUserRole(address _user) external view returns (string memory role) {
        if (_user == administrator) {
            return "Admin";
        } else if (authorizedVoters[_user]) {
            return "Voter";
        } else {
            return "Guest";
        }
    }
}
